import React from "react";
import { connect } from "redux-thunk";

class GoogleMap extends React.PureComponent {
    render() {
        return (
            <div className="info">
                <div className="geolocation">
                    <p>How to find us</p>
                    <img src="./images/geolocation.png" alt="googleMapsAPI" />
                    </div>
            </div>
            )
    }
}

export default GoogleMap;
